import React from "react";
import Navbar from "./Navbar"


const Home = () => {

    const [flavors, setFlavors] = React.useState(null);

    React.useEffect( () => {
        fetch("/")
        .then(response => response.json())
        .then(items => setFlavors(items.total));
    }, []);


    return (
        <div>
            {flavors}
        </div>
    );
}

export default Home;
